import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function NewCat(){
    class Kissakuva extends React.Component {
      render() {
        return <img src="https://cataas.com/cat" alt="kissa"></img>;
      }
    }
    ReactDOM.render(
      <Kissakuva />, document.getElementById("content"));
}
 <button id="0" value="0" onClick={this.NewCat}>New Cat!</button>


